import React from 'react'
import Manifest from './section-2.json';

const Tokenomics = () => {
    return (
        <div className='m-4 space-y-4 flex-1'>
            <div className='text-3xl font-bold'>Tokenomics</div>
            <div className='text-base font-medium'>{Manifest[0].description}</div>

            <div className='bg-gray-300 text-black'>
                <div>Supply</div>
                <div>{Manifest[0].supply}</div>
            </div>

            <div>{Manifest[0].transaction}</div>
        </div>
    )
}

const Home = () => {
    return (
        <div className='flex bg-black text-white p-2 min-h'>
            <div><Tokenomics /></div>
        </div>
    )
}

export default Home
